import { useEffect, useState } from "react";
import { useCBOContext } from "../hooks/useCBOcontext";

// Components
import WorkoutDetails from "../components/WorkoutDetails";
import CBOform from "../components/CBOform";

const Home = () => {
    const { workouts, dispatch } = useCBOContext(); // Use context instead of local state
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchWorkouts = async () => {
            try {
                const response = await fetch("/api/workouts");
                const json = await response.json();

                if (response.ok) {
                    dispatch({ type: "SET_WORKOUTS", payload: json });
                } else {
                    setError(json.error || "Failed to fetch workouts");
                }
            } catch (err) {
                setError("Error fetching workouts: " + err.message);
            }
        };

        fetchWorkouts();
    }, [dispatch]); // Runs only when dispatch changes

    return (
        <div className="home">
            {error && <div className="error">{error}</div>}
            <div className="workouts">
                {workouts && workouts.map((workout) => (
                    <WorkoutDetails key={workout._id} workout={workout} />
                ))}
            </div>
            <CBOform />
        </div>
    );
};

export default Home;
